import hierloom_salad from '../assets/images/hierloom-salad.jpg';
import ice_cream from '../assets/images/ice-cream.jpg';
import townhouse from '../assets/images/townhouse.jpg'

class Carousel extends React.Component {
    state = { 
        item: [
            {
                id: 0,
                title: "Something",
                subTitle: "sub something",
                imgSrc: hierloom_salad,
                link: "www.behance.net/jaywenphoto",
                selected: false
            },

            {
                id: 1,
                title: "Something 2",
                subTitle: "sub something 2",
                imgSrc: ice_cream,
                link: "www.behance.net/jaywenphoto",
                selected: false
            },
            {
                id: 2,
                title: "Something3",
                subTitle: "sub something3",
                imgSrc: UWS-townhouse,
                link: "www.behance.net/jaywenphoto",
                selected: false
            },
        ]
    }

    handleCardClick = (id, card) => {
        const items = [...this.state.items]
        items[id].selected = items[id]
    }
    render() {
        return(
            <h1>Carousel works</h1>

        )
    }
}

export default Carousel;
